(3, 7041125, 4, 'professionals', NULL, 1, '3,9', '63c145cb-2f74-4255-be82-721bacd34107.jpg,2920f711-52d9-4f7d-b629-813470b48201.jpg,9708e3e6-9693-4b9f-b3dc-e249152bf226.jpg,ccc5e6df-31e6-4985-a6b0-c4dceea15581.jpg,7fbdb8fb-2b88-4283-9a86-05765475acc5.jpg,74eb0a31-c5ed-4faf-b1cd-b8b6d5898791.mp4', 'טיפול פנים - בעל מקצוע ', '<p>טיפול איכותי 60 דקות בחומרים מזינים</p>\n', '<p><strong>הטיפול מיועד</strong> לנשים וגברים</p>\n\n<p>וניתן לשלבו עם שמנים איכותיים&nbsp;</p>\n\n<p>הטיפול כולל הורדת שחורים מהאף והפנים&nbsp;</p>\n\n<p>&nbsp;</p>\n', '<p><strong>הטיפול לגיל 18 ומעלה, </strong></p>\n\n<p><strong>מתאים גם לנשים בהריון ,</strong></p>\n\n<p><strong>חשוב להגיע חצי שעה לפני המפגש</strong></p>\n', '<p>הטיפול מאושר ע&quot;י משרד הבריאות, עם תו תקן בתוקף עד 2022-יוני, חניה בשפע</p>\n', 'אין החזר כספי \nמעל גיל 18 \nחובה להגיע 10 דק לפני \nאין אחריות על חפצים אישים ', NULL, 'ils', NULL, 3, 15, 10, '17,2,3,7,15', '', '', 0, '', '', NULL, 30, 20, NULL, NULL, NULL, NULL, 2, 0, 10, '41', '10.00', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '09622a02-6cb0-49d4-934b-8cb39f0353ba.pdf', 'תפריט אוכל ', '2021-08-22 10:13:00'),
(4, 5622589, 4, 'professionals', NULL, 0, '3,4', '9dd24cae-ed0a-4fc4-805a-9690ed3782aa.jpg,f8e148cb-9b9d-4ce0-9ef1-e9f0dfd336b8.jpg,676cc80e-0d17-4889-b80c-d5770b490c31.jpg,a3f70928-d565-4a8b-b0c5-4b14041555cb.jpg', 'ספא בשמים ', '<p>ספא שתיצאו ממנו בשמים חוויה בלתי נשכחת&nbsp;</p>\n', '<p>חניה בשפע&nbsp;</p>\n\n<p>קבלת פנים קלה לפני הגעה הכוללת : מרק חם , ירקות העונה , תה צמחים&nbsp;</p>\n', '<p>לגילאי 18 ומעלה&nbsp;</p>\n\n<p>חייב אישור רפואי&nbsp;</p>\n\n<p>ניתן לשלב מרגוע לאחר הטיפול ללא עלות&nbsp;</p>\n', 'פרטים טככניים ', NULL, '2d06b902-a2d5-4c7d-8c1d-ad4bf8e140f4.pdf', 'ils', NULL, 1, 0, 0, '', '', '', 0, '', '', NULL, 0, 0, NULL, NULL, 30, 15, 1, 0, 7, '', '50.00', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-08-22 10:13:00'),
(5, 2906352, 3, 'attraction', NULL, 0, '5,11', '45793081-3dc2-44ce-a1d5-43c15950b5b7.jpg,410335fb-07f5-45e4-b8e7-1d45d35c3c64.JPG,4d9491ce-6e81-4f29-bbc6-a6273d2d456e.JPG,62811cff-5af0-4059-ae43-1c5dca9b1ac4.jpg,f6f4b98d-28b0-4d8a-851f-91f98025f6bb.jpg', 'gfuy', 'gfhfgh', NULL, NULL, NULL, 'טסטסטטסטסטסטטס', NULL, 'ils', NULL, 1, 0, 0, '11', '', '', 0, '', ',,,,,,,,', NULL, 0, 0, NULL, NULL, NULL, NULL, 1, NULL, 22, '', '0.00', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-08-22 10:13:00'),
(6, 2468266, 4, 'professionals', NULL, 1, '3,13', '4666d5e8-de04-4d1a-af4a-b91522de8c57.jpg,6265632d-e872-4415-9c0e-772799cef668.jpg,25d4a9f4-b5cd-4cb8-a7c3-d52d9fa3bfaf.jpg,cc85aae4-75aa-4099-a79a-791df5dadaa4.jpg,54b8d3f1-79cb-4868-970c-037955713969.jpg,a89e319f-acc5-4469-921d-69404f3ba7e0.jpg,5a13e016-4d62-47bb-8f7d-e3db57b07bdd.jpg', ' Dinner In The Sky Israel', 'אחרי שריגשה רבבות בעולם,כבשה ערים מרכזיות ביותר מעשרים מדינות בעולם והשיגה חשיפה תקשורתית חסרת תקדים \nDinner  in the sky   מגיעה לישראל !!!!\n', 'דינר מציעה מתחם אירוח יוקרתי לעשרות עד מאות אורחים, בהתאמה אישית לצרכי הלקוח, הכולל: פינות ישיבה ובר אקסקלוסיביים עם שטיח אדום ותפריט עשיר לאורחים. \nרחפו מעל לשגרתי, התפעלו מתצפית ייחודית, נוף מרהיב וארוחת גורמה.\nתפריט : \nסלט מקורזל \nעלי אנדיב תאנה על ארבע מיקס עגבניות שרי טבעות בצל סגול אגוזי מקדמיה מקורמלים ציפס בטטה בויניגרט הדרים וקרם גזר מעט נבטי אפונה לצד קרוסטיני שומשום. \n\nטונה טטאקי\nטונה אדומה צרובה קליל על קרם חציל שחור נגיעות קולי פלפלים איולי שום רוטב סריררצה וקרם אפונה . \n\nסורבה קמפרי ליים\nפלחי אשכולית ועלי מנטה\n\nארטישוקים מהמחבט\nארטישוקים מהמחבט לצד פולנטה רכה עם פט ריות וכמהין נגיעות סלסת עגבניות פיקנטית וארטישוק.\n\nצייסר \nצייסר עראק לימוני קפוא\n\nקורנביף\nרצועות סינטה צרובות על איולי חרדל גלדי בצל עגבניות שרי קורנישונים וסלט עשבים חמצמץ עם קרוסטיני סומסום.\n\nשפונדרה על העצם\nנתחי שפונדרה בבישול ארוך על קרם תפוא וירקות שורש עם סלט מנגולד ופלפים קלויים קר . \n\nסבלה אגסים\nאגסים מבושלים ביין תבלינים, קרם וניל ואניס, סורבה אגס\n\n* התפריט הינו כשר\n* הארוחה מלווה בכוס יין אדום / לבן ,', 'ליין אפ האירוע: \n•	במתחם יתקבלו האורחים ע\"י צוות האירוח של Dinner in the sky .\n•	צוות האירוח ילווה את 22 האורחים על שטיח עד עלייתם לפלטפורמה.\n•	למעלה יוגש למשתתפים חוויה בשמים בהתאם לתפריט - בגובה 50 מטר לצליל מוזיקה \n•	האורחים ייהנו מנוף עוצר נשימה .\n•	זמן השהייה על הדינר – יקבע בהמשך לתפריט הנבחר  ותכנון האירוע.\nתפריט : \n', 'ארוחה פרימיום \nארוחת ערב יוקרתית בחוף הים בפולג האורחים יגיעו למתחם האירוח שם יקבלו אותם דיילות ויכנסו למתחם האירוח בחוף הים ויהנו ממוזיקה ושמפניה \nלאחר מכן יעלו האורחים לארוחה בשמים בהופעת שף הבית של dinner in the sky  לארוחת שף \nזמן – שעתים – חצי שעה קבלת פנים שעה בשמים וחצי שעה במתחם הרגיעה מול הים . \nשף הבית: \nשף הבית מהשפים המובילים בארץ \nעם הטאצ\' הייחודי לו ועם רזומה עשיר מאוד בתחום הקולינארי.\nהתפריט מוגדר מראש , אירועים פרטיים ניתן לגוון בתפריט . \n\n', 'אין החזר כספי \nחובה להגיע 20 דק לפני הזמן \nיש מקום חניה \n', NULL, 'ils', NULL, 3, 5, 15, '5,6,7', '', '', 0, '', '', NULL, 15, 15, NULL, NULL, 45, 15, 2, 0, 22, '', '2.00', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-08-22 10:13:00'),
