(69, 5098625, 68, 'auction', NULL, 0, '16', '7eb50802-712c-450b-ac1e-025732b4f8c7.png,e75d5d77-504d-42cc-97f7-33c2e938243e.png', 'כלאפון', '<p><strong>מתקן כלוב לפלאפונים לפינוי זמן איכות</strong></p>\n', '<p>מכירים את זה שיושבים כולם בחדר&nbsp; אחד ביחד ולא מדברים מפני שכולם מחוברים למסכים במקום לשבת ולתקשר פנים מול פנים?!</p>\n\n<p>להיט חדש!! מתקן &ldquo;כליאה&rdquo; כלוב לפלאפונים ניידים לפינוי זמן איכות.</p>\n\n<p>מפסיקים את הסחות הדעת, המתנה המושלמת למכורים לטלפון הנייד.</p>\n\n<p>מעמיד את הטלפונים כאסירים בתוך הכלוב וככה מפנים זמן איכות ללא מסכים.</p>\n\n<p>מרגישים שהראש כל הזמן בנייד? הקדמה השתלטה לכם על החיים?!</p>\n\n<p>הילדים בטח כל הזמן במסך הגיע הזמן לתת עונש לטלפון הנייד.</p>\n\n<p>המוצר המושלם לזמן איכות עם המשפחה כולל מפתחות מנעול וטיימר. במקום להיות תקועים עם הפנים מול&nbsp; הנייד מפנים קצת זמן איכות ביחד משחפה וחברים ממש כמו פעם במקום מסכים רואים אנשים.</p>\n\n<p>מתנה הומוריסטית ומשעשעת יכול לשמש כזמן איכות קבוע עם המשפחה, מתנה משעשת למשרד או &ldquo;חוק&rdquo; לפני ישיבה חשובה בעבודה מכניסים את הניידים לכלא.</p>\n\n<p>תא הכלא לניידים כולל מחזיק לטלפונים וטיימר שניתן לקבוע לכמה זמן תרצו להיפרד מהטלפונים.</p>\n', '<p>המשלוח יגיע עם שליח לכתובת שציינת בהרשמה לאתר או בעת הרכישה. ברכישה עד סכום של 150 שח המשלוח בעלות. אם בחרתם במשלוח מסוג נקודות חלוקה ולוקרים. זמן האספקה הוא בין 4-6 ימי עסקים (ימי העסקים הינם א&rsquo;-ה&rsquo; ולא כוללים סופי שבוע, חגים וערבי חג. יום ההזמנה אינו נחשב ליום עסקים). בסיום ביצוע ההזמנה וקבלת אישור הזמנה לדוא&rdquo;ל מומלץ לוודא כי כל הפרטים נכונים בפרט טלפון ליצירת קשר וכתובת למשלוח.</p>\n\n<p>הערה: לקוח/ה יקר/ה שים לב ברכישה מעל לסכום של 150 שח המוצר ישלח עם שליח עד הבית (משלוח בחינם).<br />\nובהספקה של 1-3 ימי עסקים&nbsp;,לא כולל יום הזמנה, ימי שיש וחגים.</p>\n', '<p>מה באריזה?!</p>\n\n<p>קופסת מתקן כליאה לטלפונים ניידים</p>\n\n<p>נעילה באמצעות מנעול ומפתח</p>\n\n<p>קלה לשימוש</p>\n\n<p>משטח חלק למניעת שריטות של הטלפונים</p>\n\n<p>הקופסה עשויה מפלסטיק</p>\n\n<p>גודל: 40&times;25&times;25 ס&rdquo;מ</p>\n\n<p>המארז כולל גם מנעול ומפתח וטיימר (זמן כליאה 60 דקות).</p>\n\n<p>הרכבה ב5 דקות פשוט קל ומהיר!</p>\n\n<p>מאפיינים נוספים:</p>\n\n<p>חומר: פלסטיק ABC</p>\n\n<p>מספר דגם: 6802</p>\n\n<p>לשימוש משפחה ופנאי, משרד והווי חברתי.</p>\n\n<p>משקל: 0.500 ק&rdquo;ג.</p>\n\n<p>&nbsp;</p>\n', 'המשלוח יגיע עם שליח לכתובת שציינת בהרשמה לאתר או בעת הרכישה. ברכישה עד סכום של 150 שח המשלוח בעלות. אם בחרתם במשלוח מסוג נקודות חלוקה ולוקרים. זמן האספקה הוא בין 4-6 ימי עסקים (ימי העסקים הינם א’-ה’ ולא כוללים סופי שבוע, חגים וערבי חג. יום ההזמנה אינו נחשב ליום עסקים). בסיום ביצוע ההזמנה וקבלת אישור הזמנה לדוא”ל מומלץ לוודא כי כל הפרטים נכונים בפרט טלפון ליצירת קשר וכתובת למשלוח.\n\nהערה: לקוח/ה יקר/ה שים לב ברכישה מעל לסכום של 150 שח המוצר ישלח עם שליח עד הבית (משלוח בחינם).\nובהספקה של 1-3 ימי עסקים ,לא כולל יום הזמנה, ימי שיש וחגים', NULL, 'ils', NULL, 1, 5, 10, '', '', '', 1, '14', '', NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '50.00', '[]', '99.00', '199.00', '149.00', 50, '20.00', 3, '2021-10-31 15:51:19', NULL, NULL, '2021-10-04 19:52:27'),
