(79, 2360827, 68, 'attraction', NULL, 0, '2,14', '1c2ed97a-08db-4c6a-9cd2-32aa3e3f6be8.jpg', 'צניחה חופשית', '<p>צניחה חופשית&nbsp; היא הדרך להגשים את החלום הזה.&nbsp;</p>\n', '<p>יחד עם מדריך מקצועי ומנוסה קופצים&nbsp;מהמטוס לנפילה חופשית מלאת אדרנלין במהירות של 200 קמ&quot;ש, חוויה מטורפת ושונה מכל דבר אחר שהכרתם!&nbsp;לאחר פתיחת המצנח מרחפים&nbsp;מעל קו החוף של הבונים-&nbsp;אחד מאתרי הצניחה היפים בעולם, עד לנחיתה בדשא של פרדייב.</p>\n', '<p>בכל סוף שבוע וחג צונחים מגובה של כ-12,000 רגל.&nbsp;אנחנו מאמינים שבחוויה של&nbsp;פעם&nbsp;בחיים מגיע לכם הטוב ביותר - נפילה חופשית של כ-50 שניות מעל לנוף מרהיב ועוצר נשימה.</p>\n', '<p>רטים נוספים ודגשים חשובים</p>\n\n<p>מומלץ ליצור קשר עם המועדון לפחות שבועיים לפני מועד הצניחה, על מנת שתוכלו להזמין צניחה חופשית ביום ובשעה המתאימים לכם. &nbsp; &nbsp;</p>\n\n<p>בעת הזמנת צניחה חופשית נבקש נתונים מדויקים על הצונח (כולל משקל וגובה) -&nbsp;צניחה חופשית מתאפשרת&nbsp;בהתאם ליחס בין גובה ומשקל של הצונח. בעת ההזמנה יש לדווח את הנתונים במדויק. קיימים מצבים בהם לא נוכל לאשר את ביצוע הצניחה גם לאדם אשר אינו חורג מהמגבלות שצויינו בטלפון.&nbsp;</p>\n\n<p>בעיות רפואיות- בעיות פיזיות קלות (לדוגמת: פריקת כתף, פריצת דיסק, בלט דיסק, בעיות אף אוזניים, בעיות פרקים או כל מגבלה אחרת שצוות המועדון מוצא לנכון) עשויות למנוע את ביצוע הצניחה.&nbsp;בעת ביצוע ההזמנה הטלפונית יש ליידע אותנו על כל מגבלה רפואית שהיא, גם אם נראה כי איננה עשויה להשפיע על ביצוע צניחה חופשית. אנו ננחה אתכם כיצד לפעול.&nbsp;קיימים מצבים בהם לא נוכל לאשר את ביצוע הצניחה במקום לאחר ברור מעמיק של הבעיה הרפואית.</p>\n\n<p>במקרה בו נתוני הגובה והמשקל אשר ניתנים בעת ההזמנה אינם מדויקים ו/או לא דוווחו כל הבעיות הרפואיות, הצניחה עלו', 'פעילות של צניחה חופשית ממטוס כרוכה בסיכונים העלולים להתפתח לנזקים כבדים לרבות פציעה קשה, נכות ומוות. תאונות ופציעות עלולות להתרחש בשל גורמים רבים ובשלבים שונים של הפעילות, כגון: בדרך למטוס, בשהיה בסביבת המטוס ובעליה למטוס, בשלבי הטיסה השונים, ביציאה מהמטוס, במהלך הנפילה החופשית, בפתיחת המצנח, בשלב הגלישה תחת המצנח, בנחיתה, בשהיה בשטח הנחיתה ועוד.\n\nחשוב לדעת כי תאונות או פציעות מתרחשות גם במקרים בהם הטיסה והצניחה בוצעו לפי כל הכללים ודרישות החוק והתקנות.\n\n', NULL, 'ils', NULL, 10, 0, 10, '', '', '', 0, '', '26,26', NULL, 10, 5, NULL, NULL, 30, 15, 1, 0, 5, '', '0.00', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-10-19 17:30:19'),
