  `hallWidth` int(11) DEFAULT NULL COMMENT 'מספר כסאותנקודות מטריצה לרוחב באולם אם קיים להושבה, אם לא ערך אפס. אטרקציה + בעלי מקצועמסעדה',
  `hallLength` int(11) DEFAULT NULL COMMENT 'מספר כסאותנקודות מטריצה לגובה באולם אם קיים להושבה, אם לא ערך אפס. אטרקציה + בעלי מקצועמסעדה',
  `roundTime` int(11) DEFAULT NULL COMMENT 'משך הזמן שלוקח כל סבב בדקות. אטרקציה + בעלי מקצועמסעדה',
  `reOrganizeTime` int(11) DEFAULT NULL COMMENT 'משך הפסקה בין סבבים בדקות. אטרקציה + בעלי מקצועמסעדה',
  `minimumTicketsPerOrder` int(11) DEFAULT NULL COMMENT 'מספר מינימלי של כרטיסים שיש להזמין בכל הזמנה לסבב כלשהו, תמיד יוגדר משתנה זה או minimumTicketsInFirstOrder במקומו, עדיפות למשתנה זה (במקרה ששניהם מוגדרים). אטרקציה + בעלי מקצועמסעדה',
  `minimumTicketsInFirstOrder` int(11) DEFAULT NULL COMMENT 'מספר מינימלי של כרטיסים שיש להזמין בהזמנה הראשונה לסבב כלשהו, תקף רק להזמנה הראשונה, אחכ מגבלת המינימום היא אחד (1), תמיד יוגדר משתנה זה או minimumTicketsPerOrder במקומו. אטרקציה + בעלי מקצועמסעדה',
  `maximumTicketsPerRound` int(11) DEFAULT NULL COMMENT 'מספר כרטיסים מכסימלי שניתן להכנים בכל סבב (בכל שיבוץ של עסקה ביומן). אטרקציה + בעלי מקצועמסעדה',
  `featureGroups` varchar(400) DEFAULT NULL COMMENT 'קבוצות אפשרויות שמוצעות בעסקה זו (רק ל product-food, professionals), יכלול מערך עם מזהי קבוצות האפשרויות (לדוגמא 2,4,49). מוצרמזון + בעלי מקצועמסעדה',
  `basicIskaPrice` decimal(10,2) DEFAULT NULL COMMENT 'מחיר מוצר בסיסי, מספר 2 ספרות אחרי הנקודה (רק ל product-food). מוצרמזון + בעלי מקצועמסעדה',
  `quantityDiscount` varchar(1000) NOT NULL COMMENT 'הגדרות הנחת כמות עבור העסקה (רק ל product-food), יכלול מערך של כל הנחות הכמות שהוגדרו בעסקה, גובה ההנחה באחוזים. בפורמט [quantity, discount],[quantity2, discount2]. מוצרמזון',
  `priceImport` decimal(10,2) DEFAULT NULL COMMENT 'מחיר המוצר אצל יצרןיבואן, דצימלי 2 מקומות אחרי נקודה. מכרז',
  `priceMarket` decimal(10,2) DEFAULT NULL COMMENT 'מחיר שוק של המוצרזאפ, דצימלי 2 מקומות אחרי נקודה. מכרז',
  `priceStore` decimal(10,2) DEFAULT NULL COMMENT 'מחיר המוצר בחנותקופה, דצימלי 2 מקומות אחרי נקודה. מכרז',
  `bidMinimumPrice` int(11) DEFAULT NULL COMMENT 'גובה הצעה מינימלית שניתן להגיש במכרז, מספר שלם. מכרז',
  `bidParticipateFee` decimal(10,2) DEFAULT NULL COMMENT 'דמי השתתפות להגשת הצעה במכרז. מכרז',
  `minimumBidders` int(11) DEFAULT NULL COMMENT 'מספר מציעים מינימלי לקיום המכרז. מכרז',
  `auctionExpiration` datetime DEFAULT NULL COMMENT 'מועד תוקף של המכרז, ניתן יהיה להשתתף עד מועד זה, אחרי זה נסגר. מכרז',
  `iskaAboutFileName` varchar(2000) DEFAULT NULL,
  `iskaAboutFileNameLink` varchar(100) DEFAULT NULL,
  `creationDate` datetime NOT NULL COMMENT 'מועד יצירת\\הקמת רשומת העסקה, יום ושעה'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

