CREATE TABLE `orders` (
  `idx` bigint(20) NOT NULL COMMENT 'מזהה הזמנה יחודי אוטומטי, לא בשימוש. מבנה מספר הזמנה',
  `IDorder` bigint(20) NOT NULL COMMENT 'מספר הזמנה, 6 ספרות, מופק להזמנה חדשה (ללא כפילות מול קיימים), בהוספת רשומת סאב-הזמנה (משתתף שמשלם חלק מהזמנה) יעשה שימוש במספר ההזמנה הקיים. IDorder-IDiska-IDsubOrder',
  `IDIska` bigint(20) NOT NULL COMMENT 'מזהה עסקה. ',
  `IDsubOrder` int(11) NOT NULL COMMENT 'מספר סאב-הזמנה (1,2,3 וכו), ביצירת ההזמנה עצמה לעסקה מסויימת פעם ראשונה יקבל 1, כל משתתף שמשלם או חלק נוסף של ההזמנה באותה עסקה יקבל 2, אחכ 3 וכך הלאה . ',
  `orderDate` datetime NOT NULL,
  `IDcustomer` bigint(20) NOT NULL COMMENT 'מספר מזהה לקוח (מטבלת הלקוחות) שביצע את ההזמנה. ',
  `IDpayment` bigint(20) NOT NULL COMMENT 'מספר מזהה של התשלום (מטבלת התשלומים) ששולם עבור הזמנה זו. ',
  `IDsapak` bigint(20) NOT NULL COMMENT 'מזהה ספק. ',
  `orderType` varchar(100) NOT NULL COMMENT 'סוג ההזמנה הוא אופן ביצוע העסקה שנבחר ע"י המזמין, יכול להיות אחד מאלה: משלם על הכל, משתתף עם חברים , מארגן קבוצה, תשלום יחסי, רכישה קבוצתית.. יעודכן עבור כל ס.ע',
  `orderStatus` int(11) NOT NULL COMMENT 'סטטוס ההזמנה (10-80), מספר שלם, ראה טבלת סטטוסי הזמנה. ',
  `IDinlay` bigint(20) DEFAULT NULL COMMENT 'מזהה שיבוץסבב (לאטרקציה + בעלי מקצועמסעדה בלבד). אטרקציה + בעלי מקצועמסעדה',
  `manualOrder` tinyint(1) DEFAULT NULL COMMENT 'סימון אם ההזמנה בוצעה ידנית ביומן ע"י הספק, NULL = הזמנה רגילה מהאתר, 0 = תשלום בבית העסק, 1 = שולם כבר בבית העסק. אטרקציה + בעלי מקצועמסעדה\r\n',
  `orderFeatureOptionsTotal` varchar(2000) DEFAULT NULL COMMENT 'מערך שיוזן רק להזמנה ראשונית (בכל הזמנה משנית יופיע פה NULL). איזה אפשרויות מוצר נבחרו להזמנה, מערך של מזהי אפשרויות (ערכי Idfo מטבלת featureOptions) ושל כמות (כמות תמיד תהיה זהה לכמות הכרטיסים הכולל מעסקה זו בהזמנה), וסכום כולל עבור כל אפשרות כזו. לדוגמא [{"IDfo":"2", "quantity":"4","cost":"50"},{"IDfo":"18", ,"quantity":"4","cost":"120"}]',
  `orderFeatureOptionsPaid` varchar(2000) DEFAULT NULL COMMENT 'מערך כמו בשדה orderFeaturesOptionsTotal אבל כולל רק את האפשרויות למוצר ששולמו ברשומת הזמנה זו (ראשית או משנית), בדומה לאופן ניהול של orderTicketsTotal + ordersTicketPaid, במוצר\\מזון שדה כמות יהיה: כמות של אפשרות המוצר שבהזמנה כפול מספר החלקים ששולמו חלקי מספר המשתתפים בהזמנה, ושדה מחיר יהיה שדה הכמות שהתקבל כפול עלות יחידה אחת של אפשרות למוצר זו',
  `orderUpsales` varchar(2000) DEFAULT NULL COMMENT 'מערך דו ממדי של מזהי מוצרים נלווים עם כמות לכל מוצר נלווה שכלול בהזמנה ומחיר של אותה כמות (אם היה), לדוגמא [{"IDupsale":"230", "quantity":2, "cost":"90"},{"IDupsale":"15", "quantity":1, "cost":"10"}]. כל ס.ע חוץ מ מכרז',
  `orderCoupon` bigint(20) DEFAULT NULL COMMENT 'מזהה קופון couponCode שהשתמשו בו בהזמנה זו (אם היה), לשמור פה את קוד הקופון שהקלידו (לא את מזהה יחודי IDcoupon). כל ס.ע חוץ מ מכרז, יעודכן רק ברשומת הזמנה אחת אם יש יותר מרשומה אחת באותה ההזמנה של אותו המזמין (ראשית או משנית)',
  `orderCouponAmount` decimal(10,2) NOT NULL COMMENT 'סכום ההנחה שהקנה הקופון (אם היה כזה), מספר עשרוני שני מקומות אחרי הנקודה, לכל ס.ע חוץ מ מכרז, יעודכן רק ברשומת הזמנה אחת אם יש יותר מרשומה אחת באותה ההזמנה של אותו המזמין (ראשית או משנית)',
  `timeToCompletePartsPayment` datetime DEFAULT NULL COMMENT 'זמן להשלמת התשלום ע"י משתתפים בהזמנה, בשדה יוזן מועד פקיעת התוקף של זמן זה (זמן ההגדרה ע"י מארגן ההזמנה +10 דקות, או +50 דקות וכו` או אוטומטית ל 120 דקות). לכל אופן ביצוע העסקה חוץ מ "אני משלם הכל"',
  `t4m_pre_expiration_notification` datetime NOT NULL COMMENT 'מועד שליחת התראה אחרונה טרם פקיעת תוקף ההזמנה, משמש את הסקריפט האוטומטי (שנקרא כמו שדה זה) למניעת משלוח של הודעות זהות רבות אל המזמין',
  `orderTicketsTotal` varchar(2000) DEFAULT NULL COMMENT 'מערך שיוזן רק להזמנה ראשונית (בכל הזמנה משנית יופיע פה NULL). יכלול כמה ואיזה כרטיסים הוזמנו סה"כ בהזמנה ובאיזו עלות. בס.ע מוצר\\מזון + בעלי מקצוע\\מסעדה יהיה מספר הכרטיסים והעלות שלהם, בס.ע מכרז יהיה כמות=1 וומחיר עלות ההשתתפות במכרז, ובס.ע אטרקציה יהיה מערך שיכלול סוגי כרטיסים ושם שלהם וכמה מכל סוג ובאיזו עלות, מבנה המערך לדוגמא למוצר\\מזון: [{"quantity":"4", "cost":"1000"}] (מציין 4 מוצרים סהכ בהזמנה בעלות של 1,000), או דוגמא לאטרקציה: [{"ticketType":"5", "ttName":"חייל", "quantity":6, "cost":"660"},{"ticketType":"12", "ttName":"תלמיד", "quantity":1, "cost":"50"}] (מציין 6 כרטיסים מסוג 5 בעלות של 660 + כרטיס אחד מסוג 12 בעלות 50).',
  `orderTicketsPaid` varchar(2000) NOT NULL COMMENT 'כמה כרטיסים (ואיזה סוג) שולמו בהזמנה ספציפים זו, במכרז תמיד  כמות=1 ומחיר עלות ההשתתפות במכרז, לבעלי מקצוע\\מסעדה יהיה מערך עם מספר (שלם) הכרטיסים ששולמו בהזמנה זו , ומחיר של כרטיסים אלה. לאטרקציה יהיה מערך שיכלול מזהי סוגי כרטיסים ושם שלהם, כמה מכל סוג ומה העלות של כרטיסים אלה. למוצר\\מזון יהיה מערך עם מספר החלקים ששולמו – סלאש – ומספר החלקים הכולל וציון המחיר היחסי ששולם. מבנה המערך לדוגמא לבעלי מקצוע\\מסעדה: [{"quantity":"2", "cost":"500"}] (מציין 2 מוצרים בעלות של 500), למוצר\\מזון: [{"quantity":"2/7", "cost":"285.71"}] (מציין 2 חלקים מתוך 7 של המוצר בעלות של 285.71 שח). ודוגמא לאטרקציה: [{"ticketType":"5", "ttName":"חייל", "quantity":2, "cost":"220"},{"ticketType":"12", "ttName":"תלמיד", "quantity":1, "cost":"50"}] (מציין 2 כרטיסים מסוג 5 בעלות של 220 + כרטיס אחד מסוג 12 בעלות 50.',
  `orderPartsTotal` int(11) DEFAULT NULL COMMENT 'מספר שלם מסמל כמה משתתפים יש בהזמנה, בהזמנות משנה של משתתפים יופיע פה אפס, באטרקציה ובעלי מקצוע יהיה NULL, במכרז תמיד 1. זה כמה משתתפים או חלקים יש בהזמנה ראשונית שהוגדרה, מה שהגדירו ב pp5',
  `orderPartsPaid` int(11) DEFAULT NULL COMMENT 'מספר החלקים ששולמו בהזמנה זו (מתוך סך המשתתפים שהוגדר בהזמנה הראשונית). כמה שולמו בהזמנה ראשית זו או תת הזמנה זו (אם זו רשומה של תת הזמנה), באטרקציה ובעלי מקצוע NULL, במכרז תמיד 1, בשאר ס.ע יהיה מספר הצ`קבוקסים שהמזמין סימן לעצמו לשלם ב pp5. זה כמה חלקים שולמו בפועל בהזמנה ספציפית זו (תקף לראשונית וגם למשנית)',
  `orderFriendsShareDiscount` int(11) NOT NULL COMMENT 'הנחה באחוזים עבור שיתוף 5 חברים ע"פ מה שסימן בעת ההזמנה (אם היה כזה). כל העסקאות, יעודכן רק ברשומת הזמנה אחת אם יש יותר מרשומה אחת באותה ההזמנה של אותו המזמין (ראשית או משנית)',
  `orderFriendsShareDiscountAmount` decimal(10,2) DEFAULT NULL COMMENT 'סכום הנחת שיתוף חברים (אם היה כזה), עשרוני שני מקומות אחרי הנקודה, יעודכן רק ברשומת הזמנה אחת אם יש יותר מרשומה אחת באותה ההזמנה של אותו המזמין (ראשית או משנית)',
  `orderShipment` varchar(1500) DEFAULT NULL COMMENT 'תקף רק למוצר\\מזון + מכרז, בכל ס.ע אחר יהיה NULL, יכלול מערך JSON עם הנתונים: (1) סוג משלוח שבחר type יכול להיות free (חינם), self-pickup (איסוף עצמי) או regular-shipment (משלוח רגיל), (2) מזהה סניף (IDbranch) אם איסוף עצמי או מזהה משלוח (IDshipment) אם רגיל. (3) שם המשלוח, (4) עלות המשלוח.  לדוגמא: [{"type":"regular-shipment", "id":"4", "cost":"50", "name":"משלוח מהיר עם שליח", "details":"יופץ במהלך שעות העבודה"}] ',
  `orderShipmentFirstName` varchar(30) DEFAULT NULL COMMENT 'שם פרטי למשלוח, אם אין יהיה NULL. מוצרמזון + מכרז',
  `orderShipmentLastName` varchar(30) DEFAULT NULL COMMENT 'שם משפחה למשלוח, אם אין יהיה NULL. מוצרמזון + מכרז',
  `orderShipmentPhoneNumber` varchar(10) DEFAULT NULL COMMENT 'טלפון נייד למשלוח, אם אין יהיה NULL. מוצרמזון + מכרז',
  `orderShipmentCity` varchar(30) DEFAULT NULL COMMENT 'עיר למשלוח, אם אין יהיה NULL. מוצרמזון + מכרז',
  `orderShipmentStreet` varchar(30) DEFAULT NULL COMMENT 'רחוב למשלוח, אם אין יהיה NULL. מוצרמזון + מכרז',
  `orderShipmentHouseNumber` varchar(30) DEFAULT NULL COMMENT 'מספר בית למשלוח, אם אין יהיה NULL. מוצרמזון + מכרז',
  `orderShipmentAppartment` varchar(30) DEFAULT NULL COMMENT 'מספר דירה למשלוח, אם אין יהיה NULL. מוצרמזון + מכרז',
  `orderShipmentRemarks` varchar(300) DEFAULT NULL COMMENT 'הערות לשליח, אם אין יהיה NULL. מוצרמזון + מכרז',
  `IDbranch` bigint(20) DEFAULT NULL COMMENT 'מספר סניף של הספק אליו שוייכה ההזמנה (יש כזה רק אם בחרו משלוח כלשהו). מוצרמזון + מכרז',
  `orderBidPrice` decimal(10,2) DEFAULT NULL COMMENT 'סכום שהוצע במכרז עבור הפריט, מספר עם שתי מקומות אחרי הנקודה, תקף רק לס.ע. מכרז'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

