CREATE TABLE `payments` (
  `IDpayment` bigint(20) NOT NULL COMMENT 'מזהה תשלום יחודי אוטומטי, לא בשימוש. ',
  `IDcustomer` bigint(20) NOT NULL COMMENT 'מזהה לקוח שביצע את התשלום. ',
  `IDorder` bigint(20) NOT NULL COMMENT 'מספר ההזמנה עבורה בוצע התשלום. ',
  `IDsubOrder` int(11) NOT NULL COMMENT 'מזהה סאב-הזמנה עבורה בוצע התשלום. ',
  `paymentDate` datetime NOT NULL COMMENT 'מועד ביצוע התשלום תאריך + שעה. ',
  `paymentAmount` decimal(10,2) NOT NULL COMMENT 'סכום ששולם, עשרוני שתי מקומות אחרי הנקודה. ',
